import React, { ReactElement } from 'react';
import { Provider } from 'react-redux';
import { LocaleProvider } from 'antd';
import { utils } from 'demo-common';
import zhCN from 'antd/es/locale-provider/zh_CN';

type Props = {
  children: ReactElement<any>;
};

const Wrapper = ({ children }: Props) => (
  <LocaleProvider locale={zhCN}>
    <Provider store={utils.stateContainer._store}>{children}</Provider>
  </LocaleProvider>
);

export default Wrapper;
try {
    // @ts-ignore
    DocWrapper.displayName = "DocWrapper";
    // @ts-ignore
    DocWrapper.__docgenInfo = { "description": "", "displayName": "DocWrapper", "props": {} };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/DocWrapper.tsx#DocWrapper"] = { docgenInfo: DocWrapper.__docgenInfo, name: "DocWrapper", path: "src/DocWrapper.tsx#DocWrapper" };
}
catch (__react_docgen_typescript_loader_error) { }
